import React from 'react';
import {
  Container,
  Typography,
  Box,
  Paper,
  Theme,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import PhoneIcon from '@mui/icons-material/Phone';
import EmailIcon from '@mui/icons-material/Email';

const ContactContainer = styled(Box)(({ theme }: { theme: Theme }) => ({
  minHeight: 'calc(100vh - 200px)',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
}));

const ContactCard = styled(Paper)(({ theme }: { theme: Theme }) => ({
  padding: theme.spacing(6),
  textAlign: 'center',
  maxWidth: 500,
  width: '100%',
  backgroundColor: '#FAF9F6',
  boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
}));

const ContactInfo = styled(Box)(({ theme }: { theme: Theme }) => ({
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  margin: theme.spacing(3, 0),
  '& svg': {
    marginRight: theme.spacing(2),
    color: '#1A3A5F',
  },
}));

const Contact: React.FC = () => {
  return (
    <ContactContainer>
      <Container>
        <ContactCard elevation={3}>
          <Typography variant="h4" component="h1" gutterBottom sx={{ color: '#1A3A5F', fontWeight: 700 }}>
            Get in Touch
          </Typography>
          
          <Typography variant="h5" sx={{ mb: 4, color: '#1A3A5F' }}>
            Stanley Cassar Darien
          </Typography>

          <ContactInfo>
            <PhoneIcon />
            <Typography variant="h6" sx={{ color: '#1A3A5F' }}>
              +356 9933 2288
            </Typography>
          </ContactInfo>

          <ContactInfo>
            <EmailIcon />
            <Typography variant="h6" sx={{ color: '#1A3A5F' }}>
              Stanmalta@hotmail.co.uk
            </Typography>
          </ContactInfo>
        </ContactCard>
      </Container>
    </ContactContainer>
  );
};

export default Contact;
